ion: 48.27 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 1197 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 113.49 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 24.66 s &lt;/li&gt;\n&lt;li&gt; transfer time: 492.43 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.0.226:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 32 &lt;/li&gt;\n          &lt;li&gt; Threads: 768 &lt;/li&gt;\n          &lt;li&gt; Memory: 5.40 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.perf_counter()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.perf_counter() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"bottom":{"field":"bottom"},"fill_alpha":{"value":0.2},"fill_color":{"field":"color"},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_alpha":{"value":0.2},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1105","type":"Quad"},{"attributes":{"source":{"id":"1213"}},"id":"1246","type":"CDSView"},{"attributes":{"overlay":{"id":"1060"}},"id":"1057","type":"BoxZoomTool"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{},"id":"1445","type":"AllLabels"},{"attributes":{"coordinates":null,"formatter":{"id":"1444"},"group":null,"major_label_policy":{"id":"1445"},"ticker":{"id":"1049"},"visible":false},"id":"1048","type":"LinearAxis"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1468","type":"MonthsTicker"},{"attributes":{"dimensions":"width"},"id":"1388","type":"WheelZoomTool"},{"attributes":{"dimensions":"width"},"id":"1058","type":"WheelZoomTool"},{"attributes":{"children":[{"id":"1216"},{"id":"1249"},{"id":"1282"},{"id":"1368"}],"sizing_mode":"stretch_both"},"id":"1399","type":"Column"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{},"id":"1017","type":"BasicTicker"},{"attributes":{"c
